class Helado {
  constructor(id, imagen, nombre, enStock, descuento = 0) {
    this.id = id;
    this.imagen = imagen;
    this.nombre = nombre;
    this.enStock = enStock;
    this.descuento = descuento;
  }
}

export default Helado;
